import{_ as a,a as r,b as i,c as l}from"./chunks/FMU_Debug_Port_Horizontal.CZlcrhnb.js";import{_ as t,c as o,a8 as s,o as n}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"Holybro Pix32 v5","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/holybro_pix32_v5.md","filePath":"ko/flight_controller/holybro_pix32_v5.md"}'),h={name:"ko/flight_controller/holybro_pix32_v5.md"};function p(d,e,c,u,m,f){return n(),o("div",null,e[0]||(e[0]=[s('<h1 id="holybro-pix32-v5" tabindex="-1">Holybro Pix32 v5 <a class="header-anchor" href="#holybro-pix32-v5" aria-label="Permalink to &quot;Holybro Pix32 v5&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><a href="https://holybro.com/products/pix32-v5" target="_blank" rel="noreferrer">Pix32 v5</a><sup>®</sup> is an advanced autopilot flight controller designed and made by Holybro<sup>®</sup>. PX4 펌웨어 실행에 최적화 되어 있으며, 연구와 상업용 개발자들에게 적합합니다. It is based on the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk-project</a> <strong>FMUv5</strong> open hardware design and runs PX4 on the <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS. Pixhawk4의 변형 버전으로 간주할 수 있습니다.</p><p>Pix32 v5는 고출력, 유연하고 사용자 정의 가능한 비행제어 시스템을 위하여 설계되었습니다. 별도의 비행 컨트롤러와 캐리어 보드로 구성되며 100핀 커넥터로 연결됩니다. 이 디자인은 사용자가 Holybro에서 만든베이스 보드를 선택하거나 사용자가 정의할 수 있습니다.</p><p><img src="'+a+'" alt="Pix32 v5 Family"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="요약" tabindex="-1">요약 <a class="header-anchor" href="#요약" aria-label="Permalink to &quot;요약&quot;">​</a></h2><ul><li>메인 FMU 프로세서: STM32F765 <ul><li>32 비트 Arm® Cortex®-M7, 216MHz, 2MB 메모리, 512KB RAM</li></ul></li><li>IO 프로세서: STM32F100 <ul><li>32 비트 Arm® Cortex®-M3, 24MHz, 8KB SRAM</li></ul></li><li>내장 센서 : <ul><li>가속도/자이로: ICM-20689</li><li>Accel/Gyro: BMI055 or ICM20602</li><li>자력계 : IST8310</li><li>기압계: MS5611</li></ul></li><li>GPS: u-blox Neo-M8N GPS/GLONASS 수신기; 통합 자력계 IST8310</li><li>인터페이스: <ul><li>PWM 출력 8-16개(IO에서 8개, FMU에서 8개)</li><li>FMU의 전용 PWM/캡처 입력 3 개</li><li>CPPM 전용 RC 입력</li><li>아날로그/PWM RSSI 입력이있는 Spektrum/DSM 및 S.Bus 전용 RC 입력</li><li>Dedicated S.Bus servo output</li><li>범용 시리얼 포트 5개 <ul><li>전체 흐름 제어 2개</li><li>1.5A 전류 제한이 있는 1 개</li></ul></li><li>I2C 포트 3개</li><li>SPI 버스 4개 <ul><li>4 개의 칩 선택 및 6 개의 DRDY가 있는 내부 고속 SPI 센서 버스 1 개</li><li>XXX 전용 내부 저잡음 SPI 버스 1 개</li><li>2 개의 칩 선택이 있는 기압계, DRDY 없음</li><li>FRAM 전용 내부 SPI 버스 1 개</li><li>센서 모듈에 위치한 전용 SPI 교정 EEPROM 지원</li><li>외부 SPI 버스 1개</li></ul></li><li>직렬 ESC를 사용하는 듀얼 CAN에 최대 2 개의 CAN 버스 <ul><li>각 CANBus에는 개별 무음 제어 또는 ESC RX-MUX 제어가 있습니다.</li><li>배터리 2 개의 전압 및 전류에 대한 아날로그 입력</li><li>2개의 추가 아날로그 입력</li></ul></li></ul></li><li>전기 시스템 : <ul><li>전원 모듈 출력: 4.9~5.5V</li><li>최대 입력 전압: 6V</li><li>최대 전류 감지: 120A</li><li>USB 전원 입력: 4.75~5.25V</li><li>서보 레일 입력: 0~36V</li></ul></li><li>중량과 크기 <ul><li>크기: 45x45x13.5mm</li><li>중량: 33.9g</li></ul></li><li>Environmental Data, Quality &amp; Reliability: <ul><li>작동 온도: -40 ~ 85°c</li><li>보관 온도. -40~85℃</li><li>CE</li><li>FCC</li><li>RoHS 준수(무연)</li></ul></li></ul><p>Additional information can be found in the <a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5_technical_data_sheet_v1.1.pdf" target="_blank" rel="noreferrer">Pix32 V5 Technical Data Sheet</a>.</p><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p>Order from <a href="https://holybro.com/products/pix32-v5" target="_blank" rel="noreferrer">Holybro website</a>.</p><h2 id="조립-및-설정" tabindex="-1">조립 및 설정 <a class="header-anchor" href="#조립-및-설정" aria-label="Permalink to &quot;조립 및 설정&quot;">​</a></h2><p>The <a href="./../assembly/quick_start_holybro_pix32_v5.html">Pix32 v5 Wiring Quick Start</a> provides instructions on how to assemble required/important peripherals including GPS, Power Management Board etc.</p><h2 id="베이스-보드-레이아웃" tabindex="-1">베이스 보드 레이아웃 <a class="header-anchor" href="#베이스-보드-레이아웃" aria-label="Permalink to &quot;베이스 보드 레이아웃&quot;">​</a></h2><p><img src="'+r+'" alt="Pix32 v5 Image"></p><h2 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h2><p><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_Pix32-V5-Base-Mini-Pinouts.pdf" target="_blank" rel="noreferrer"><em>pix32 v5</em> and mini baseboard</a></p><h2 id="크기" tabindex="-1">크기 <a class="header-anchor" href="#크기" aria-label="Permalink to &quot;크기&quot;">​</a></h2><p><img src="'+i+'" alt="Pix32 v5 Image"></p><h2 id="정격-전압" tabindex="-1">정격 전압 <a class="header-anchor" href="#정격-전압" aria-label="Permalink to &quot;정격 전압&quot;">​</a></h2><p><em>Pix32 v5</em> can be triple-redundant on the power supply if three power sources are supplied. The three power rails are: <strong>POWER1</strong>, <strong>POWER2</strong> and <strong>USB</strong>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The output power rails <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 36V) do not power the flight controller board (and are not powered by it). You must supply power to one of <strong>POWER1</strong>, <strong>POWER2</strong> or <strong>USB</strong> or the board will be unpowered.</p></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>이러한 조건에서 전원은 아래의 순서대로 시스템에 전원을 공급하여야합니다.</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (4.9V to 5.5V)</li><li><strong>USB</strong> input (4.75V to 5.25V)</li></ol><p><strong>Absolute Maximum Ratings</strong></p><p>아래의 조건에서 시스템은 전원을 사용하지 않지만(작동하지 않음), 그대로 유지됩니다.</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (operational range 4.1V to 5.7V, 0V to 10V undamaged)</li><li><strong>USB</strong> input (operational range 4.1V to 5.7V, 0V to 6V undamaged)</li><li>Servo input: VDD_SERVO pin of <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 42V undamaged)</li></ol><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_pix32v5_default</span></span></code></pre></div><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><p>The system&#39;s <a href="./../debug/system_console.html">serial console</a> and SWD interface runs on the <strong>FMU Debug</strong> port</p><p><img src="'+l+'" alt="FMU debug port diagram"></p><p>The pinout uses the standard <a href="./../debug/swd_debug.html#pixhawk-debug-mini">Pixhawk Debug Mini</a> interface defined in the <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a>.</p><h2 id="주변-장치" tabindex="-1">주변 장치 <a class="header-anchor" href="#주변-장치" aria-label="Permalink to &quot;주변 장치&quot;">​</a></h2><ul><li><a href="./../sensor/airspeed.html">Digital Airspeed Sensor</a></li><li><a href="./../telemetry/">Telemetry Radio Modules</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="지원-플랫폼-및-기체" tabindex="-1">지원 플랫폼 및 기체 <a class="header-anchor" href="#지원-플랫폼-및-기체" aria-label="Permalink to &quot;지원 플랫폼 및 기체&quot;">​</a></h2><p>일반 RC 서보 또는 Futaba S-Bus 서보로 제어 가능한 모든 멀티콥터/비행기/로버 또는 보트. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5_technical_data_sheet_v1.1.pdf" target="_blank" rel="noreferrer">Pix32 v5 Technical Data Sheet</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_Pix32-V5-Base-Mini-Pinouts.pdf" target="_blank" rel="noreferrer">Pix32 v5 Pinouts</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5-BASE-Schematic_diagram.pdf" target="_blank" rel="noreferrer">Pix32 v5 Base Board Schematic Diagram</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5-Base-Mini-Board_Schematic_diagram.pdf" target="_blank" rel="noreferrer">Pix32 v5 Mini Base Board Schematic Diagram</a></li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a>.</li></ul>',42)]))}const _=t(h,[["render",p]]);export{P as __pageData,_ as default};
